import React from "react";
import "./Page.css";
import List from "./List";

function Page({ mainCookie, intro, section, info, logo }) {

  return (
    <div className="Page">
        <div className = "circle">
            <div className = "section-container">
                <img src={mainCookie} alt="Circle Content" className="profpic" />
                <p className="section-name">{section}</p>
            </div>
        </div>

        <div className = "section-info">
            {intro && <div dangerouslySetInnerHTML={{ __html: intro}} /> }
            {logo && <img src={logo} alt="Logo" className="logo" />}


            {Array.isArray(info) ? (
                <List data={info} />
            ) : (
                <p className="additional-info">{info}</p>
            )}
        </div>

    </div>
  );
}

export default Page;
